import { useState } from 'react'
let Contact = ()=>{
    
    let arr = ["red", "green", "blue", "yellow", "pink", "black"];
    
    return(
        <>
            <div className="container" style={{minHeight : "650px"}}>
                {
                    arr.map((x)=>{
                        return(<h1>{x}</h1>)
                    })
                }
            </div>
        </>
    )


}

export default Contact;
